/*Table structure for table `balancelog` */

DROP TABLE IF EXISTS `balancelog`;

CREATE TABLE `balancelog` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `userId` bigint(20) NOT NULL COMMENT '用户id',
  `type` int(11) NOT NULL COMMENT '1入，2支出',
  `platform` int(11) NOT NULL COMMENT '1网站2后台',
  `money` int(11) NOT NULL COMMENT '交易金额',
  `afterBalance` decimal(10,0) NOT NULL COMMENT '交易后余额',
  `operId` bigint(20) NOT NULL COMMENT '操作人id',
  `createtime` datetime NOT NULL COMMENT '操作时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='余额日志表';

/*Data for the table `balancelog` */

/*Table structure for table `brand` */

DROP TABLE IF EXISTS `brand`;

CREATE TABLE `brand` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `name` varchar(20) NOT NULL COMMENT '品牌名称',
  `url` varchar(254) DEFAULT NULL COMMENT 'url',
  `isUse` int(11) NOT NULL DEFAULT '1' COMMENT '1使用0不使用',
  `createtime` datetime NOT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='品牌表';

/*Data for the table `brand` */

/*Table structure for table `category` */

DROP TABLE IF EXISTS `category`;

CREATE TABLE `category` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `code` varchar(255) CHARACTER SET utf8 NOT NULL COMMENT '品类code',
  `name` varchar(20) CHARACTER SET utf8 NOT NULL COMMENT '品类名称',
  `layer` int(11) NOT NULL COMMENT '1级分类2级分类3级分类',
  `fid` int(11) NOT NULL DEFAULT '0' COMMENT '父品类id',
  `isUse` int(11) NOT NULL DEFAULT '1' COMMENT '1使用0不使用',
  `createtime` datetime NOT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='品类表';

/*Data for the table `category` */

/*Table structure for table `cgoods` */

DROP TABLE IF EXISTS `cgoods`;

CREATE TABLE `cgoods` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `gid` bigint(20) NOT NULL COMMENT '商品id',
  `cgname` varchar(254) NOT NULL COMMENT '子商品标签',
  `price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '价格',
  `mprice` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '市场价',
  `aprice` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '活动价',
  `state` int(11) NOT NULL DEFAULT '1' COMMENT '状态1上架2下架127不可见',
  `createtime` datetime NOT NULL COMMENT '创建时间',
  `modifytime` datetime DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='子商品表';

/*Data for the table `cgoods` */

/*Table structure for table `favorite` */

DROP TABLE IF EXISTS `favorite`;

CREATE TABLE `favorite` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `userId` bigint(20) NOT NULL COMMENT '用户id',
  `cgoodsId` bigint(20) NOT NULL COMMENT '商品id',
  `isDel` int(11) NOT NULL DEFAULT '1' COMMENT '1正常127删除',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='我的最爱';

/*Data for the table `favorite` */

/*Table structure for table `gcategory` */

DROP TABLE IF EXISTS `gcategory`;

CREATE TABLE `gcategory` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `code` varchar(255) NOT NULL COMMENT '品类code',
  `gid` bigint(20) NOT NULL COMMENT '商品id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='商品品类表';

/*Data for the table `gcategory` */

/*Table structure for table `gdetail` */

DROP TABLE IF EXISTS `gdetail`;

CREATE TABLE `gdetail` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `cgid` bigint(20) NOT NULL COMMENT '商品id',
  `photo` varchar(60) DEFAULT NULL COMMENT '主图',
  `photo1` varchar(60) DEFAULT NULL COMMENT '付图1',
  `photo2` varchar(60) DEFAULT NULL COMMENT '付图2',
  `photo3` varchar(60) DEFAULT NULL COMMENT '付图3',
  `photo4` varchar(60) DEFAULT NULL COMMENT '付图4',
  `descript` varchar(2000) DEFAULT NULL COMMENT '详情描述',
  PRIMARY KEY (`id`),
  UNIQUE KEY `gid` (`cgid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='商品详情表';

/*Data for the table `gdetail` */

/*Table structure for table `goods` */

DROP TABLE IF EXISTS `goods`;

CREATE TABLE `goods` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `gname` varchar(50) NOT NULL COMMENT '商品名称',
  `remark` varchar(254) DEFAULT NULL COMMENT '描述',
  `place` varchar(100) DEFAULT NULL COMMENT '产地',
  `state` int(11) NOT NULL DEFAULT '0' COMMENT '0不可见1上架2下架',
  `createtime` datetime NOT NULL COMMENT '创建时间',
  `modifytime` datetime DEFAULT NULL COMMENT '修改时间',
  `merchantId` bigint(20) NOT NULL COMMENT '商家id',
  `brandId` bigint(20) DEFAULT NULL COMMENT '品牌id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='商品表';

/*Data for the table `goods` */

/*Table structure for table `gstock` */

DROP TABLE IF EXISTS `gstock`;

CREATE TABLE `gstock` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `cgid` bigint(20) NOT NULL COMMENT '商品id',
  `number` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '库存',
  `anumber` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '活动库存',
  PRIMARY KEY (`id`),
  UNIQUE KEY `gid` (`cgid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='库存';

/*Data for the table `gstock` */

/*Table structure for table `husers` */

DROP TABLE IF EXISTS `husers`;

CREATE TABLE `husers` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `username` varchar(20) NOT NULL COMMENT '用户名',
  `password` varchar(32) NOT NULL COMMENT '密码',
  `createtime` datetime NOT NULL COMMENT '创建时间',
  `isDel` int(11) NOT NULL DEFAULT '1' COMMENT '是否删除',
  `roleId` int(11) DEFAULT NULL COMMENT '角色',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='后台用户表';

/*Data for the table `husers` */

/*Table structure for table `merchant` */

DROP TABLE IF EXISTS `merchant`;

CREATE TABLE `merchant` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `username` varchar(20) NOT NULL COMMENT '商家用户名',
  `password` varchar(32) NOT NULL COMMENT '密码',
  `mobile` varchar(20) NOT NULL COMMENT '手机',
  `name` varchar(254) NOT NULL COMMENT '商家名',
  `qq` varchar(20) DEFAULT NULL COMMENT 'qq号',
  `address` varchar(254) NOT NULL COMMENT '详细地址',
  `alipay` varchar(50) DEFAULT NULL COMMENT '支付宝商户号',
  `createtime` datetime NOT NULL COMMENT '创建时间',
  `modifytime` datetime DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='商家表';

/*Data for the table `merchant` */

/*Table structure for table `oaddress` */

DROP TABLE IF EXISTS `oaddress`;

CREATE TABLE `oaddress` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `orderId` bigint(20) NOT NULL COMMENT '订单id',
  `provinceId` int(11) NOT NULL COMMENT '省id',
  `provinceName` varchar(10) NOT NULL COMMENT '省名称',
  `cityId` int(11) NOT NULL COMMENT '市id',
  `cityName` varchar(10) NOT NULL COMMENT '市名称',
  `areaId` int(11) NOT NULL COMMENT '区id',
  `areaName` varchar(10) NOT NULL COMMENT '区名称',
  `remark` varchar(254) NOT NULL COMMENT '详细地址',
  `consignee` varchar(20) NOT NULL COMMENT '收货人',
  `mobile` varchar(20) NOT NULL COMMENT '收货人手机号',
  PRIMARY KEY (`id`),
  UNIQUE KEY `orderId` (`orderId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='订单地址';

/*Data for the table `oaddress` */

/*Table structure for table `odetail` */

DROP TABLE IF EXISTS `odetail`;

CREATE TABLE `odetail` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `orderId` bigint(20) NOT NULL COMMENT '订单id',
  `goodsId` bigint(20) NOT NULL COMMENT '商品id',
  `buyPrice` decimal(10,0) NOT NULL DEFAULT '0' COMMENT '购买价格',
  `number` int(11) NOT NULL DEFAULT '1' COMMENT '购买数量',
  `isDelivery` int(11) NOT NULL DEFAULT '0' COMMENT '是否已经收货',
  `isSend` int(11) NOT NULL DEFAULT '0' COMMENT '是否已经发货',
  `deliveryTime` datetime DEFAULT NULL COMMENT '收货时间',
  `sendTime` datetime DEFAULT NULL COMMENT '发货时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `odetail` */

/*Table structure for table `opaytype` */

DROP TABLE IF EXISTS `opaytype`;

CREATE TABLE `opaytype` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `orderId` bigint(20) NOT NULL,
  `code` int(11) NOT NULL COMMENT '付款方式code1余额2支付宝3微信',
  `name` varchar(10) NOT NULL,
  `account` varchar(255) DEFAULT NULL COMMENT '订单付款账户',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `opaytype` */

/*Table structure for table `orders` */

DROP TABLE IF EXISTS `orders`;

CREATE TABLE `orders` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `orderNum` varchar(50) NOT NULL COMMENT '订单号',
  `state` int(11) NOT NULL DEFAULT '1' COMMENT '1正常2取消3异常',
  `status` int(11) NOT NULL DEFAULT '1' COMMENT '1未确认2已确认3处理中4已发货5确认收货6退货中7退货完成',
  `orderPrice` decimal(10,0) NOT NULL DEFAULT '0' COMMENT '订单金额',
  `paidPrice` decimal(10,0) NOT NULL DEFAULT '0' COMMENT '已付金额',
  `payPrice` decimal(10,0) NOT NULL DEFAULT '0' COMMENT '应付金额',
  `productPrice` decimal(10,0) NOT NULL DEFAULT '0' COMMENT '商品总额',
  `discountPrice` decimal(10,0) NOT NULL DEFAULT '0' COMMENT '优惠金额',
  `balancePrice` decimal(10,0) NOT NULL DEFAULT '0' COMMENT '使用余额金额',
  `isPaid` int(11) NOT NULL DEFAULT '1' COMMENT '1未支付2已支付',
  `userId` bigint(20) NOT NULL COMMENT '用户id',
  `createtime` datetime NOT NULL COMMENT '创建时间',
  `modifytime` datetime DEFAULT NULL COMMENT '修改时间',
  `merchantId` bigint(20) NOT NULL COMMENT '商家id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='订单表';

/*Data for the table `orders` */

